import React from 'react';
import HomePage from './pages/HomePage';
import ProductPage from './pages/ProductPage';
import './styles/styles.scss';

import BottomFooter from "./components/Footer/BottomFooter/index";
import RestaurantPage from "./pages/RestaurantPage";
import MainContainer from "./pages/Container";
import AuthenticatePage from "./pages/AuthenticatePage";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams,
  useRouteMatch
} from "react-router-dom";

export const ThemeContext = React.createContext('light');

class App extends React.Component {

  constructor(props) {
    super(props)

    this.state = {
      isNotMainPages: true
    }
  }

  yourHandler = (previousRoute, nextRoute) => {

  }

  render() {
    return (
      <ThemeContext.Provider value='light'>
        <Router onChange={this.yourHandler}>
          {/* {
            this.state.isNotMainPages
              ? <ApplicationRouter />
              : <MainContainer>
                <ApplicationRouter />
              </MainContainer>
          } */}
          <ApplicationRouter />
        </Router>
      </ThemeContext.Provider>
    )
  }
}

function ApplicationRouter() {
  return (
    <Switch>
      <Route path="/" >
        <MainContainer>
          <Route exact path="/home">
            <HomePage />
          </Route>

          <Route path="/restaurant/:id">
            <RestaurantPage />
          </Route>
        </MainContainer>
      </Route>


      <Route path="login/session">
        <AuthenticatePage />
      </Route>
    </Switch>
  );
}

export default App;
